import novemberDirectExpenses from './november/charts/direct-expenses';
import novemberTotalExpenses from './november/charts/total-expenses';
import novemberGeneral from './november/tables/general';
import novemberAheadActivities from './november/tables/summary-of-main-activities/ahead-activities';
import novemberLateActivities from './november/tables/summary-of-main-activities/late-activities';

interface IMainActivities {
  item: string;
  activity: string;
  prev: string;
  real: string;
  physical_deviation: string;
}

interface IChartData {
  bars: Array<{
    color: string;
    name: string;
    data: number[];
  }>;
  categories: Array<string>;
}

interface IBuild {
  directExpenses: IChartData;
  totalExpenses: IChartData;
  general: Array<object>;
  aheadActivities: IMainActivities[];
  lateActivities: IMainActivities[];
}

export default {
  directExpenses: novemberDirectExpenses,
  totalExpenses: novemberTotalExpenses,
  general: novemberGeneral,
  aheadActivities: novemberAheadActivities,
  lateActivities: novemberLateActivities,
} as IBuild;
